import axios from 'axios';


const initState = async () => {
    const todoListArr = axios.get('http://localhost:4000/todos').then(res => {
        console.log(res.data);
        return res.data;
    });


    return initState;
}

const todoList = (state = {}, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default todoList;
